import React from 'react';
import { FaFacebookF, FaTwitter, FaLinkedinIn, FaInstagram, FaBehance } from 'react-icons/fa';

function Home() {
  return (
    <div className="home-container">
      <div className="content-wrapper">
        <h2>WELCOME!</h2>
        <h1>I Am Web Designer</h1>
        <p>I'm a Web Developer with extensive experience for over 5 years. My expertise is to create and Websites design, graphic design and many more...</p>
        <div className="social-icons">
          <a href="#" className="icon-link"><FaFacebookF /></a>
          <a href="#" className="icon-link"><FaTwitter /></a>
          <a href="#" className="icon-link"><FaLinkedinIn /></a>
          <a href="#" className="icon-link"><FaInstagram /></a>
          <a href="#" className="icon-link"><FaBehance /></a>
        </div>
      </div>
      <div className="image-wrapper">
        {/* Add your image here */}
      </div>
    </div>
  );
}

export default Home;
